import ReactTable from 'react-table-6' // React-table
import {useState, useEffect} from 'react' // State storage for calculations

export default function TransactionList(props) {


    function Hash(props) {

        return(
            <>
                <div className="marketItem">
                    <div>
                        {props.hash}
                    </div>

                </div>
                <style jsx>{`
            .marketItem {
                display: inline-block;
                height: 70px;
                width: 270px;
            }
            .marketItem > div {
                display: inline-block;
                height: 100%;
            }
            .marketItem > div:nth-child(1) {
                width: 80px;
                vertical-align: top;
            }
            .marketItem > div:nth-child(2) {
                width: 190px;
                vertical-align: top;
            }
            .marketItem > div > img {
                height: 43.5px;
                width: 43.5px;
                transform: translate(18.25px, 13.25px);
            }
            .marketItem > div > span {
                display: inline-block;
                transform: translateY(19px);
            }
            .marketItem > div > span:nth-of-type(1) {
                font-weight: bold;
            }
            .marketItem > div > span:nth-of-type(2) {
                color: #ACBBC2;
                font-size: 14px;
            }
            `}</style>
            </>
        )
    }

    function From(props) {
//debugger

        return(
            <>
                <div className="marketItem">
                    <div>
                        {props.from}
                    </div>

                </div>
                <style jsx>{`
            .marketItem {
                display: inline-block;
                height: 70px;
                width: 270px;
            }
            .marketItem > div {
                display: inline-block;
                height: 100%;
            }
            .marketItem > div:nth-child(1) {
                width: 80px;
                vertical-align: top;
            }
            .marketItem > div:nth-child(2) {
                width: 190px;
                vertical-align: top;
            }
            .marketItem > div > img {
                height: 43.5px;
                width: 43.5px;
                transform: translate(18.25px, 13.25px);
            }
            .marketItem > div > span {
                display: inline-block;
                transform: translateY(19px);
            }
            .marketItem > div > span:nth-of-type(1) {
                font-weight: bold;
            }
            .marketItem > div > span:nth-of-type(2) {
                color: #ACBBC2;
                font-size: 14px;
            }
            `}</style>
            </>
        )
    }




    // React-table setup
    const columns = [
        {Header: 'Hash транзакции', Accessor: 'Hash', Cell: row => <Hash {...row.original} />},
        {Header: 'Адрес отправителя', Accessor: 'gross_supply', Cell: row => <From {...row.original}/>},

    ];

    return (
        <>
            <ReactTable
                data={props.data}
                columns={columns}
                showPagination={false}
                defaultPageSize={props.data.length}
                resizable={false}
                className="comp-table"
            />
            <div className="token-distribution">
                <span>Calculated token distribution</span>
                <br />
                <br />
            </div>
            <style global jsx>{`
            .token-distribution {
                width: calc(100% - 80px);
                margin: 20px;
                padding: 20px;
                background-color: rgba(214, 2, 44, 0.1);
                border: 1px solid rgb(214, 2, 44);
                border-radius: 5px;
                text-align: center;
            }
            .token-distribution > span {
                font-weight: bold;
                text-decoration: underline;
            }
            .token-distribution > div {
                display: inline-block;
                padding: 5px;
            }
            .token-distribution > div > label {
                display: block;
            }
            .token-distribution > div > input {
                display: block;
                height: 30px;
                margin-top: 5px;
                border: 1px solid #ccc;
                border-radius: 5px;
                text-align: center;
                font-size: 17px;
                width: 160px;
            }
            .-header {
                height: 30px;
                border-bottom: 1px solid #e7eaf3;
                box-shadow: none !important;
            }
            .-header > .rt-tr {
                font-size: 13px;
                font-weight: bold;
